INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (1, 1000, 2, "訓練はまだ\nここからですわ", 3000, 2, "vo_minigame_1013_icon_2_002_001", 2, "調子が上がって\nきたなっ", "vo_minigame_1013_icon_1_002_001");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (2, 5000, 2, "クスクス、悪くない\n流れですわね", 3000, 2, "vo_minigame_1013_icon_2_003_001", 2, "ほらほら、\nまだいけるだろ？", "vo_minigame_1013_icon_1_003_001");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (3, 10000, 2, "すばらしい\n記録ですわ", 3000, 2, "vo_minigame_1013_icon_2_004_001", 3, "へへっ、おまえら\nやるじゃねえか！", "vo_minigame_1013_icon_1_004_001");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (4, 10000, 3, "乗りに乗って\nいますわね", 3000, 2, "vo_minigame_1013_icon_2_005_001", 3, "あたしたちはまだ\n止まらねえぜ！", "vo_minigame_1013_icon_1_005_001");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (5, 10000, 3, "まだまだ行きます\nついてきなさい", 3000, 2, "vo_minigame_1013_icon_2_005_002", 3, "見てろよ！\nマコト班の快進撃だ！", "vo_minigame_1013_icon_1_005_002");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (6, 10000, 3, "エリコ班の\n本領発揮ですわ！", 3000, 2, "vo_minigame_1013_icon_2_005_003", 3, "うおぉぉっ！\n絶好調だぜ！", "vo_minigame_1013_icon_1_005_003");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (7, 0, 4, "ここからは\n前人未到の領域です！", 3000, 2, "vo_minigame_1013_icon_2_006_001", 3, "どこまで行けるか\n楽しみだなっ！", "vo_minigame_1013_icon_1_006_001");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (8, 1, 5, "厄介でしたわ…", 1000, 3, "vo_minigame_1013_icon_2_007_001", 4, "まだ諦めんなよっ", "vo_minigame_1013_icon_1_007_001");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (9, 1, 5, "油断大敵です", 1000, 3, "vo_minigame_1013_icon_2_007_002", 4, "冷やっとしたぜ…！", "vo_minigame_1013_icon_1_007_002");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (10, 1, 5, "忌々しいっ…", 1000, 3, "vo_minigame_1013_icon_2_007_003", 4, "弱音を吐くなっ", "vo_minigame_1013_icon_1_007_003");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (11, 99, 6, "大所帯ですわね", 1500, 4, "vo_minigame_1013_icon_2_008_001", 3, "マコト班集合！", "vo_minigame_1013_icon_1_008_001");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (12, 99, 6, "エリコ班へようこそ", 1500, 4, "vo_minigame_1013_icon_2_008_002", 3, "連携してくぞ！", "vo_minigame_1013_icon_1_008_002");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (13, 0, 8, "ナナカちゃんに\nお任せあれ", 3000, 1, "vo_minigame_1013_icon_2_020_001", 6, "みんなに力を！", "vo_minigame_1013_icon_1_020_001");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (14, 0, 9, "はっはっは！\n任せろ！", 3000, 1, "vo_minigame_1013_icon_2_022_001", 7, "任せてくれたまえ", "vo_minigame_1013_icon_1_022_001");
INSERT INTO `v1_319e0ea78b23840d4ddaeca0a4240c932e189d3eda1dfdc808c7b7043767e430` VALUES (15, 0, 10, "どんどんいくわよ", 3000, 1, "vo_minigame_1013_icon_2_023_001", 8, "ほな、いきまひょか", "vo_minigame_1013_icon_1_023_001");
